                          bel, the neper is not a unit in the International System
                          of Units (SI), but it is accepted for use alongside the
                          SI. Like the decibel, the neper is a unit in a logarithmic
                          scale. While the bel uses the decadic (base-10) logarithm
                          to compute ratios, the neper uses the natural logarithm,
                          based on Euler's number
