              vaem:GraphMetaData:
                tag: vaem:GraphMetaData
                value:
                  rdf:HTML:
                    tag: rdf:HTML
                    value:
                      object:
                        tag: object
                        value: '<p class="lm-para">The QUDT, or "Quantity, Unit, Dimension
                          and Type" schema defines the base classes properties, and
                          restrictions used for modeling physical quantities, units
                          of measure, and their dimensions in various measurement
                          systems. The goal of the QUDT ontology is to provide a unified
                          model of, measurable quantities, units for measuring different
                          kinds of quantities, the numerical values of quantities
                          in different units of measure and the data structures and
                          data types used to store and manipulate these objects in
                          software.</p>


                          <p class="lm-para">Except for unit prefixes, all units are
                          specified in separate vocabularies. Descriptions are provided
                          in both HTML and LaTeX formats. A quantity is a measure
                          of an observable phenomenon, that, when associated with
                          something, becomes a property of that thing; a particular
                          object, event, or physical system. </p>


                          <p class="lm-para">A quantity has meaning in the context
                          of a measurement (i.e. the thing measured, the measured
                          value, the accuracy of measurement, etc.) whereas the underlying
                          quantity kind is independent of any particular measurement.
                          Thus, length is a quantity kind while the height of a rocket
                          is a specific quantity of length; its magnitude that may
                          be expressed in meters, feet, inches, etc.  Or, as stated
                          at Wikipedia, in the language of measurement, quantities
                          are quantifiable aspects of the world, such as time, distance,
                          velocity, mass, momentum, energy, and weight, and units
                          are used to describe their measure. Many of these quantities
                          are related to each other by various physical laws, and
                          as a result the units of some of the quantities can be expressed
                          as products (or ratios) of powers of other units (e.g.,
                          momentum is mass times velocity and velocity is measured
                          in distance divided by time).</p>'
                      predicate:
                        tag: predicate
                        value: dct:description
                      subject:
                        tag: subject
                        value: vaem:GMD_QUDT-SCHEMA
