classes:
  qudt_AbstractQuantityKind:
    class_uri: qudt:AbstractQuantityKind
    is_a: qudt_Concept
    name: qudt_AbstractQuantityKind
    source: http://qudt.org/schema/qudt
    title: Quantity Kind (abstract)
  qudt_AngleUnit:
    class_uri: qudt:AngleUnit
    description: All units relating to specification of angles.
    exact_mappings:
    - http://dbpedia.org/resource/Category:Units_of_angle
    is_a: qudt_DimensionlessUnit
    name: qudt_AngleUnit
    source: http://qudt.org/schema/qudt
    title: Angle unit
  qudt_Aspect:
    class_uri: qudt:Aspect
    name: qudt_Aspect
    title: No class (entity type) name specified -- this class is noted as a superclass
      of another class in this graph but has not itself been defined.
  qudt_AspectClass:
    class_uri: qudt:AspectClass
    is_a: rdfs_Class
    name: qudt_AspectClass
    slots:
    - rdfs_comment
    - rdfs_label
    - rdfs_isDefinedBy
    - rdfs_subClassOf
    source: http://qudt.org/schema/qudt
    title: Aspect Class
  qudt_BaseDimensionMagnitude:
    class_uri: qudt:BaseDimensionMagnitude
    description: "<p class=\"lm-para\">A <em>Dimension</em> expresses a magnitude\
      \ for a base quantiy kind such as mass, length and time.</p>\u240A<p class=\"\
      lm-para\">DEPRECATED - each exponent is expressed as a property. Keep until\
      \ a validaiton of this has been done.</p>"
    is_a: qudt_Concept
    name: qudt_BaseDimensionMagnitude
    source: http://qudt.org/schema/qudt
    title: Base Dimension Magnitude
  qudt_BinaryPrefix:
    class_uri: qudt:BinaryPrefix
    description: A <em>Binary Prefix</em> is a prefix for multiples of units in data
      processing, data transmission, and digital information, notably the bit and
      the byte, to indicate multiplication by a power of 2.
    is_a: qudt_Prefix
    name: qudt_BinaryPrefix
    slots:
    - rdfs_label
    - dct_description
    - qudt_prefixMultiplier
    - qudt_symbol
    - rdfs_isDefinedBy
    - qudt_prefixMultiplierSN
    - qudt_ucumCode
    source: http://qudt.org/schema/qudt
    title: Binary Prefix
  qudt_BitEncodingType:
    class_uri: qudt:BitEncodingType
    description: A bit encoding is a correspondence between the two possible values
      of a bit, 0 or 1, and some interpretation. For example, in a boolean encoding,
      a bit denotes a truth value, where 0 corresponds to False and 1 corresponds
      to True.
    is_a: qudt_Encoding
    name: qudt_BitEncodingType
    slots:
    - rdfs_label
    - qudt_bits
    - rdfs_isDefinedBy
    source: http://qudt.org/schema/qudt
    title: Bit Encoding
  qudt_BooleanEncodingType:
    class_uri: qudt:BooleanEncodingType
    is_a: qudt_Encoding
    name: qudt_BooleanEncodingType
    slots:
    - rdfs_label
    - qudt_bits
    - dc_description
    - rdfs_isDefinedBy
    - qudt_bytes
    source: http://qudt.org/schema/qudt
    title: Boolean encoding type
  qudt_ByteEncodingType:
    class_uri: qudt:ByteEncodingType
    description: This class contains the various ways that information may be encoded
      into bytes.
    is_a: qudt_Encoding
    name: qudt_ByteEncodingType
    slots:
    - qudt_bytes
    - rdfs_label
    - rdfs_isDefinedBy
    source: http://qudt.org/schema/qudt
    title: Byte Encoding
  qudt_CardinalityType:
    class_uri: qudt:CardinalityType
    description: "In mathematics, the cardinality of a set is a measure of the number\
      \ of elements of the set.\u240A  For example, the set $A = {2, 4, 6}$ contains\
      \ 3 elements, and therefore $A$ has a cardinality of 3. \u240A  There are two\
      \ approaches to cardinality: one which compares sets directly using bijections\
      \ and injections,\u240A   and another which uses cardinal numbers."
    is_a: qudt_EnumeratedValue
    name: qudt_CardinalityType
    slots:
    - rdfs_label
    - dtype_literal
    - dct_description
    - rdfs_isDefinedBy
    - qudt_informativeReference
    source: http://qudt.org/schema/qudt
    title: Cardinality Type
  qudt_CharEncodingType:
    class_uri: qudt:CharEncodingType
    description: The class of all character encoding schemes, each of which defines
      a rule or algorithm for encoding character data as a sequence of bits or bytes.
    is_a: qudt_Encoding
    name: qudt_CharEncodingType
    slots:
    - qudt_bytes
    - rdfs_isDefinedBy
    - rdfs_label
    - dc_description
    source: http://qudt.org/schema/qudt
    title: Char Encoding Type
  qudt_Citation:
    class_uri: qudt:Citation
    description: Provides a simple way of making citations.
    is_a: qudt_Concept
    name: qudt_Citation
    source: http://qudt.org/schema/qudt
    title: Citation
  qudt_Comment:
    class_uri: qudt:Comment
