  qudt_CurrencyUnit:
    class_uri: qudt:CurrencyUnit
    comments:
    - 'description: Used for all units that express currency.'
    description: 'Currency Units have their own subclass of unit because: (a) they
      have additonal properites such as ''country'' and (b) their URIs do not conform
      to the same rules as other units.'
    is_a: qudt_DimensionlessUnit
    name: qudt_CurrencyUnit
