  qudt_DataEncoding:
    class_uri: qudt:DataEncoding
    description: <p><em>Data Encoding</em> expresses the properties that specify how
      data is represented at the bit and byte level. These properties are applicable
      to describing raw data.</p>
    is_a: qudt_Aspect
    name: qudt_DataEncoding
    source: http://qudt.org/schema/qudt
    title: Data Encoding
  qudt_DataItem:
    class_uri: qudt:DataItem
    description: "<p>A <em>Data Item</em> holds a value that maybe a scalar or structured\
      \ datatype.\u240A  <em>Quantity Value</em> specifies which case applies.\u240A\
      \  </p>"
    is_a: qudt_Concept
    name: qudt_DataItem
    source: http://qudt.org/schema/qudt
    title: Data Item
  qudt_Datatype:
    class_uri: qudt:Datatype
    description: "<p>A <em>Datatype</em> is a definition of the type of the \"value\"\
      \ of a data item (for example, \"all integers between 0 and 10\"),\u240A   and\
      \ the allowable operations on those values; the meaning of the data; and the\
      \ way values of that type can be stored. \u240A  Some types are primitive -\
      \ built-in to the language, with no visible internal structure.\u240A  For example\
      \ \"Boolean\"; others are composite - constructed from one or more other types\
      \ (of either kind).\u240A  For example lists, arrays, structures, unions. \u240A\
      \  Some languages provide strong typing, others allow implicit type conversion\
      \ and/or explicit type conversion.\u240A  </p>"
    is_a: qudt_Concept
    name: qudt_Datatype
    source: http://qudt.org/schema/qudt
    title: QUDT Datatype
  qudt_DateTimeStringEncodingType:
    class_uri: qudt:DateTimeStringEncodingType
    description: Date Time encodings are logical encodings for expressing date/time
      quantities as strings by applying unambiguous formatting and parsing rules.
    is_a: qudt_StringEncodingType
    name: qudt_DateTimeStringEncodingType
    slots:
