    class_uri: qudt:Discipline
    is_a: qudt_Concept
    name: qudt_Discipline
    source: http://qudt.org/schema/qudt
    title: Discipline
  qudt_Encoding:
    class_uri: qudt:Encoding
    description: An encoding is a rule or algorithm that is used to convert data from
      a native, or unspecified form into a specific form that satisfies the encoding
      rules. Examples of encodings include character encodings, such as UTF-8.
    is_a: qudt_Concept
    name: qudt_Encoding
    source: http://qudt.org/schema/qudt
    title: Encoding
  qudt_EndianType:
    class_uri: qudt:EndianType
    is_a: qudt_EnumeratedValue
    name: qudt_EndianType
    slots:
    - rdfs_label
    - rdfs_isDefinedBy
    - dtype_literal
    source: http://qudt.org/schema/qudt
    title: Endian Type
  qudt_EnumeratedValue:
    class_uri: qudt:EnumeratedValue
    description: "<p>This class is for all enumerated and/or coded values.  For example,\
      \ it contains the dimension objects that are the basis elements in some abstract\
      \ vector space associated with a quantity kind system. Another use is for the\
      \ base dimensions for quantity systems. Each quantity kind system that defines\
      \ a base set has a corresponding ordered enumeration whose elements are the\
      \ dimension objects for the base quantity kinds. The order of the dimensions\
      \ in the enumeration determines the canonical order of the basis elements in\
      \ the corresponding abstract vector space.</p>\u240A\u240A<p>An enumeration\
      \ is a set of literals from which a single value is selected. Each literal can\
      \ have a tag as an integer within a standard encoding appropriate to the range\
      \ of integer values. Consistency of enumeration types will allow them, and the\
      \ enumerated values, to be referred to unambiguously either through symbolic\
      \ name or encoding. Enumerated values are also controlled vocabularies and as\
      \ such need to be standardized. Without this consistency enumeration literals\
      \ can be stated differently and result in  data conflicts and misinterpretations.</p>\u240A\
      \u240A<p>The tags are a set of positive whole numbers, not necessarily contiguous\
      \ and having no numerical significance, each corresponding to the associated\
      \ literal identifier. An order attribute can also be given on the enumeration\
      \ elements. An enumeration can itself be a member of an enumeration. This allows\
      \ enumerations to be enumerated in a selection. Enumerations are also subclasses\
      \ of Scalar Datatype. This allows them to be used as the reference of a datatype\
      \ specification.</p>"
    is_a: dtype_EnumeratedValue
    name: qudt_EnumeratedValue
    source: http://qudt.org/schema/qudt
    title: Enumerated Value
  qudt_Enumeration:
    class_uri: qudt:Enumeration
    description: "<p>An enumeration is a set of literals from which a single value\
      \ is selected. Each literal can have a tag as an integer within a standard encoding\
      \ appropriate to the range of integer values. Consistency of enumeration types\
      \ will allow them, and the enumerated values, to be referred to unambiguously\
      \ either through symbolic name or encoding. Enumerated values are also controlled\
      \ vocabularies and as such need to be standardized. Without this consistency\
      \ enumeration literals can be stated differently and result in  data conflicts\
      \ and misinterpretations.</p>\u240A\u240A<p>The tags are a set of positive whole\
      \ numbers, not necessarily contiguous and having no numerical significance,\
      \ each corresponding to the associated literal identifier. An order attribute\
      \ can also be given on the enumeration elements. An enumeration can itself be\
      \ a member of an enumeration. This allows enumerations to be enumerated in a\
      \ selection. Enumerations are also subclasses of <em>Scalar Datatype</em>. This\
      \ allows them to be used as the reference of a datatype specification.</p>"
    is_a: dtype_Enumeration
    name: qudt_Enumeration
    source: http://qudt.org/schema/qudt
    title: Enumeration
  qudt_EnumerationScale:
    class_uri: qudt:EnumerationScale
    is_a: dtype_Enumeration
    name: qudt_EnumerationScale
    source: http://qudt.org/schema/qudt
    title: Enumeration scale
  qudt_Figure:
    class_uri: qudt:Figure
    is_a: qudt_Concept
    name: qudt_Figure
    source: http://qudt.org/schema/qudt
    title: Figure
  qudt_FloatingPointEncodingType:
    class_uri: qudt:FloatingPointEncodingType
    description: 'A "Encoding" with the following instance(s): "Double Precision Encoding",
      "Single Precision Real Encoding".'
    is_a: qudt_Encoding
    name: qudt_FloatingPointEncodingType
    slots:
    - qudt_bytes
    - rdfs_label
    - rdfs_isDefinedBy
    source: http://qudt.org/schema/qudt
    title: Floating Point Encoding
  qudt_IntegerEncodingType:
    class_uri: qudt:IntegerEncodingType
    description: The encoding scheme for integer types
    is_a: qudt_Encoding
    name: qudt_IntegerEncodingType
    slots:
    - qudt_bytes
    - rdfs_label
    - rdfs_isDefinedBy
    source: http://qudt.org/schema/qudt
    title: Integer Encoding
  qudt_IntervalScale:
    class_uri: qudt:IntervalScale
    comments:
    - 'description: median, percentile & Monotonic increasing (order (<)) & totally
      ordered set'
    description: "<p>The interval type allows for the degree of difference between\
      \ items, but not the ratio between them. Examples include temperature with the\
      \ Celsius scale, which has two defined points (the freezing and boiling point\
      \ of water at specific conditions) and then separated into 100 intervals, date\
      \ when measured from an arbitrary epoch (such as AD), percentage such as a percentage\
      \ return on a stock,[16] location in Cartesian coordinates, and direction measured\
      \ in degrees from true or magnetic north. Ratios are not meaningful since 20\
      \ \xB0C cannot be said to be \"twice as hot\" as 10 \xB0C, nor can multiplication/division\
      \ be carried out between any two dates directly. However, ratios of differences\
      \ can be expressed; for example, one difference can be twice another. Interval\
      \ type variables are sometimes also called \"scaled variables\", but the formal\
      \ mathematical term is an affine space (in this case an affine line).</p>\u240A\
      <p>Characteristics: median, percentile &amp; Monotonic increasing (order (&lt;)\
      \ &amp; totally ordered set</p>"
    is_a: qudt_Scale
    name: qudt_IntervalScale
    see_also:
    - http://qudt.org/schema/qudt/NominalScale
    - http://qudt.org/schema/qudt/OrdinalScale
    - http://qudt.org/schema/qudt/RatioScale
    source: http://qudt.org/schema/qudt
    title: Interval scale
  qudt_LogarithmicUnit:
    class_uri: qudt:LogarithmicUnit
    description: Logarithmic units are abstract mathematical units that can be used
      to express any quantities (physical or mathematical) that are defined on a logarithmic
      scale, that is, as being proportional to the value of a logarithm function.
      Examples of logarithmic units include common units of information and entropy,
      such as the bit, and the byte, as well as units of relative signal strength
      magnitude such as the decibel.
    is_a: qudt_DimensionlessUnit
    name: qudt_LogarithmicUnit
    slots:
    - rdfs_label
    - qudt_hasDimensionVector
    - qudt_hasQuantityKind
    - qudt_dbpediaMatch
    - qudt_iec61360Code
    - qudt_ucumCode
    - qudt_conversionMultiplierSN
    - dct_description
    - qudt_siExactMatch
    - qudt_symbol
    - rdfs_isDefinedBy
    - qudt_informativeReference
    - qudt_applicableSystem
    - qudt_conversionMultiplier
    - qudt_uneceCommonCode
    source: http://qudt.org/schema/qudt
    title: Logarithmic Unit
  qudt_MathsFunctionType:
    class_uri: qudt:MathsFunctionType
    is_a: qudt_Concept
    name: qudt_MathsFunctionType
    source: http://qudt.org/schema/qudt
    title: Maths Function Type
  qudt_NIST_SP811_Comment:
    class_uri: qudt:NIST_SP811_Comment
    description: National Institute of Standards and Technology (NIST) Special Publication
      811 Comments on some quantities and their units
    is_a: qudt_Comment
    name: qudt_NIST_SP811_Comment
    source: http://qudt.org/schema/qudt
    title: NIST SP~811 Comment
  qudt_NominalScale:
    class_uri: qudt:NominalScale
    description: 'A nominal scale differentiates between items or subjects based only
      on their names or (meta-)categories and other qualitative classifications they
      belong to; thus dichotomous data involves the construction of classifications
      as well as the classification of items. Discovery of an exception to a classification
      can be viewed as progress. Numbers may be used to represent the variables but
      the numbers do not have numerical value or relationship: For example, a Globally
      unique identifier. Examples of these classifications include gender, nationality,
      ethnicity, language, genre, style, biological species, and form. In a university
      one could also use hall of affiliation as an example.'
    is_a: qudt_Scale
    name: qudt_NominalScale
    see_also:
    - http://qudt.org/schema/qudt/IntervalScale
    - http://qudt.org/schema/qudt/OrdinalScale
    - http://qudt.org/schema/qudt/RatioScale
    source: http://qudt.org/schema/qudt
    title: Nominal scale
  qudt_OrderedType:
    class_uri: qudt:OrderedType
    description: Describes how a data or information structure is ordered.
    is_a: qudt_EnumeratedValue
    name: qudt_OrderedType
    slots:
    - rdfs_label
    - dtype_literal
    - rdfs_isDefinedBy
    - qudt_plainTextDescription
    source: http://qudt.org/schema/qudt
    title: Ordered type
  qudt_OrdinalScale:
    class_uri: qudt:OrdinalScale
    description: The ordinal type allows for rank order (1st, 2nd, 3rd, etc.) by which
      data can be sorted, but still does not allow for relative degree of difference
      between them. Examples include, on one hand, dichotomous data with dichotomous
      (or dichotomized) values such as 'sick' vs. 'healthy' when measuring health,
      'guilty' vs. 'innocent' when making judgments in courts, 'wrong/false' vs. 'right/true'
      when measuring truth value, and, on the other hand, non-dichotomous data consisting
      of a spectrum of values, such as 'completely agree', 'mostly agree', 'mostly
      disagree', 'completely disagree' when measuring opinion.
    is_a: qudt_Scale
    name: qudt_OrdinalScale
    see_also:
    - http://qudt.org/schema/qudt/IntervalScale
    - http://qudt.org/schema/qudt/NominalScale
    - http://qudt.org/schema/qudt/RatioScale
    source: http://qudt.org/schema/qudt
    title: Ordinal scale
  qudt_Organization:
    class_uri: qudt:Organization
    is_a: qudt_Concept
    name: qudt_Organization
    source: http://qudt.org/schema/qudt
    title: Organization
  qudt_PhysicalConstant:
    class_uri: qudt:PhysicalConstant
    description: "A physical constant is a physical quantity that is generally believed\
      \ to be both universal in nature and constant in time. It can be contrasted\
      \ with a mathematical constant, which is a fixed numerical value but does not\
      \ directly involve any physical measurement. There are many physical constants\
      \ in science, some of the most widely recognized being the speed of light in\
      \ vacuum c, Newton's gravitational constant G, Planck's constant h, the electric\
      \ permittivity of free space \u03B50, and the elementary charge e. Physical\
      \ constants can take many dimensional forms, or may be dimensionless depending\
      \ on the system of quantities and units used."
    is_a: qudt_Quantity
    name: qudt_PhysicalConstant
    source: http://qudt.org/schema/qudt
    title: Physical Constant
  qudt_PlaneAngleUnit:
    class_uri: qudt:PlaneAngleUnit
    is_a: qudt_AngleUnit
    name: qudt_PlaneAngleUnit
    source: http://qudt.org/schema/qudt
    title: Plane Angle Unit
  qudt_Prefix:
    class_uri: qudt:Prefix
    is_a: qudt_Verifiable
    name: qudt_Prefix
    source: http://qudt.org/schema/qudt
    title: Prefix
  qudt_Quantifiable:
    class_uri: qudt:Quantifiable
    description: <p><em>Quantifiable</em> ascribes to some thing the capability of
      being measured, observed, or counted.</p>
    is_a: qudt_Aspect
    name: qudt_Quantifiable
    source: http://qudt.org/schema/qudt
    title: Quantifiable
  qudt_Quantity:
    class_uri: qudt:Quantity
    description: "<p class=\"lm-para\">A <b>quantity</b> is the measurement of an\
      \ observable property of a particular object, event, or physical system. \u240A\
      \  A quantity is always associated with the context of measurement (i.e. the\
      \ thing measured, the measured value, the accuracy of measurement, etc.) whereas\
      \ the \u240A  underlying <b>quantity kind</b> is independent of any particular\
      \ measurement. Thus, length is a quantity kind while the height of a rocket\
      \ is a specific \u240A  quantity of length; its magnitude that may be expressed\
      \ in meters, feet, inches, etc. Examples of physical quantities include physical\
      \ constants, such as \u240A  the speed of light in a vacuum, Planck's constant,\
      \ the electric permittivity of free space, and the fine structure constant.\
      \ </p>\u240A<p class=\"lm-para\">In other words, quantities are quantifiable\
      \ aspects of the world, such as the duration of a movie, the distance between\
      \ two points, \u240Avelocity of a car, the pressure of the atmosphere, and a\
      \ person's weight; and units are used to describe their numerical measure.</p>\
      \ \u240A<p class=\"lm-para\">Many <b>quantity kinds</b> are related to each\
      \ other by various physical laws, and as a result, the associated units of some\
      \ quantity \u240Akinds can be expressed as products (or ratios) of powers of\
      \ other quantity kinds (e.g., momentum is mass times velocity and velocity is\
      \ defined as distance \u240Adivided by time). In this way, some quantities can\
      \ be calculated from other measured quantities using their associations to the\
      \ quantity kinds in these \u240Aexpressions. These quantity kind relationships\
      \ are also discussed in dimensional analysis. Those that cannot be so expressed\
      \ can be regarded \u240Aas \"fundamental\" in this sense.</p>\u240A<p class=\"\
      lm-para\">A quantity is distinguished from a \"quantity kind\" in that the former\
      \ carries a value and the latter is a type specifier.</p>"
    is_a: qudt_Quantifiable
    name: qudt_Quantity
    source: http://qudt.org/schema/qudt
    title: Quantity
  qudt_QuantityKind:
    class_uri: qudt:QuantityKind
    description: A <b>Quantity Kind</b> is any observable property that can be  measured
      and quantified numerically. Familiar examples include physical properties such
      as length, mass, time, force, energy, power, electric charge, etc. Less familiar
      examples include currency, interest rate, price to earning ratio, and information
      capacity.
    is_a: qudt_Verifiable
    name: qudt_QuantityKind
    source: http://qudt.org/schema/qudt
    title: Quantity Kind
  qudt_QuantityKindDimensionVector:
    class_uri: qudt:QuantityKindDimensionVector
    description: "<p class=\"lm-para\">A  <em>Quantity Kind Dimension Vector</em>\
      \ describes the dimensionality of a quantity kind in the context of a system\
      \ of units. In the SI system of units, the dimensions of a quantity kind are\
      \ expressed as a product of the basic physical dimensions mass ($M$), length\
      \ ($L$), time ($T$) current ($I$), amount of substance ($N$), luminous intensity\
      \ ($J$) and absolute temperature ($\\theta$) as $dim \\, Q = L^{\\alpha} \\\
      , M^{\\beta} \\, T^{\\gamma} \\, I ^{\\delta} \\, \\theta ^{\\epsilon} \\, N^{\\\
      eta} \\, J ^{\\nu}$.</p>\u240A\u240A<p class=\"lm-para\">The rational powers\
      \ of the dimensional exponents, $\\alpha, \\, \\beta, \\, \\gamma, \\, \\delta,\
      \ \\, \\epsilon, \\, \\eta, \\, \\nu$, are positive, negative, or zero.</p>\u240A\
      \u240A<p class=\"lm-para\">For example, the dimension of the physical quantity\
      \ kind $\\it{speed}$ is $\\boxed{length/time}$, $L/T$ or $LT^{-1}$, and the\
      \ dimension of the physical quantity kind force is $\\boxed{mass \\times acceleration}$\
      \ or $\\boxed{mass \\times (length/time)/time}$, $ML/T^2$ or $MLT^{-2}$ respectively.</p>"
    is_a: qudt_Concept
    name: qudt_QuantityKindDimensionVector
    source: http://qudt.org/schema/qudt
    title: Quantity Kind Dimension Vector
  qudt_QuantityKindDimensionVector_CGS:
    class_uri: qudt:QuantityKindDimensionVector_CGS
    description: A <em>CGS Dimension Vector</em> is used to specify the dimensions
      for a C.G.S. quantity kind.
    is_a: qudt_QuantityKindDimensionVector
    name: qudt_QuantityKindDimensionVector_CGS
    source: http://qudt.org/schema/qudt
    title: CGS Dimension vector
  qudt_QuantityKindDimensionVector_CGS-EMU:
    class_uri: qudt:QuantityKindDimensionVector_CGS-EMU
    description: A <em>CGS EMU Dimension Vector</em> is used to specify the dimensions
      for EMU C.G.S. quantity kind.
    is_a: qudt_QuantityKindDimensionVector_CGS
    name: qudt_QuantityKindDimensionVector_CGS-EMU
    source: http://qudt.org/schema/qudt
    title: CGS EMU Dimension vector
  qudt_QuantityKindDimensionVector_CGS-ESU:
    class_uri: qudt:QuantityKindDimensionVector_CGS-ESU
    description: A <em>CGS ESU Dimension Vector</em> is used to specify the dimensions
      for ESU C.G.S. quantity kind.
    is_a: qudt_QuantityKindDimensionVector_CGS
    name: qudt_QuantityKindDimensionVector_CGS-ESU
    source: http://qudt.org/schema/qudt
    title: CGS ESU Dimension vector
  qudt_QuantityKindDimensionVector_CGS-GAUSS:
    class_uri: qudt:QuantityKindDimensionVector_CGS-GAUSS
    description: A <em>CGS GAUSS Dimension Vector</em> is used to specify the dimensions
      for Gaussioan C.G.S. quantity kind.
    is_a: qudt_QuantityKindDimensionVector_CGS
    name: qudt_QuantityKindDimensionVector_CGS-GAUSS
    source: http://qudt.org/schema/qudt
    title: CGS GAUSS Dimension vector
  qudt_QuantityKindDimensionVector_CGS-LH:
    class_uri: qudt:QuantityKindDimensionVector_CGS-LH
    description: A <em>CGS LH Dimension Vector</em> is used to specify the dimensions
      for Lorentz-Heaviside C.G.S. quantity kind.
    is_a: qudt_QuantityKindDimensionVector_CGS
    name: qudt_QuantityKindDimensionVector_CGS-LH
    source: http://qudt.org/schema/qudt
    title: CGS LH Dimension vector
  qudt_QuantityKindDimensionVector_ISO:
    class_uri: qudt:QuantityKindDimensionVector_ISO
    is_a: qudt_QuantityKindDimensionVector
    name: qudt_QuantityKindDimensionVector_ISO
    source: http://qudt.org/schema/qudt
    title: ISO Dimension vector
  qudt_QuantityKindDimensionVector_Imperial:
    class_uri: qudt:QuantityKindDimensionVector_Imperial
    is_a: qudt_QuantityKindDimensionVector
    name: qudt_QuantityKindDimensionVector_Imperial
    source: http://qudt.org/schema/qudt
    title: Imperial dimension vector
  qudt_QuantityKindDimensionVector_SI:
    class_uri: qudt:QuantityKindDimensionVector_SI
    is_a: qudt_QuantityKindDimensionVector
    name: qudt_QuantityKindDimensionVector_SI
    source: http://qudt.org/schema/qudt
    title: Quantity Kind Dimension vector (SI)
  qudt_QuantityType:
    class_uri: qudt:QuantityType
    description: "A $\\textit{Quantity Type}$ is an enumeration of quantity kinds.\
      \ \u240A  It specializes $\\boxed{dtype:EnumeratedValue}$ by constrinaing $\\\
      boxed{dtype:value}$ to instances of $\\boxed{qudt:QuantityKind}$."
    is_a: qudt_EnumeratedValue
    name: qudt_QuantityType
    source: http://qudt.org/schema/qudt
    title: Quantity type
  qudt_QuantityValue:
    class_uri: qudt:QuantityValue
    description: A <i>Quantity Value</i> expresses the magnitude and kind of a quantity
      and is given by the product of a numerical value <code>n</code> and a unit of
      measure <code>U</code>. The number multiplying the unit is referred to as the
      numerical value of the quantity expressed in that unit. Refer to <a href="http://physics.nist.gov/Pubs/SP811/sec07.html">NIST
      SP 811 section 7</a> for more on quantity values.
    is_a: qudt_Quantifiable
    name: qudt_QuantityValue
    source: http://qudt.org/schema/qudt
    title: Quantity value
  qudt_RatioScale:
    class_uri: qudt:RatioScale
    description: The ratio type takes its name from the fact that measurement is the
      estimation of the ratio between a magnitude of a continuous quantity and a unit
      magnitude of the same kind (Michell, 1997, 1999). A ratio scale possesses a
      meaningful (unique and non-arbitrary) zero value. Most measurement in the physical
      sciences and engineering is done on ratio scales. Examples include mass, length,
      duration, plane angle, energy and electric charge. In contrast to interval scales,
      ratios are now meaningful because having a non-arbitrary zero point makes it
      meaningful to say, for example, that one object has "twice the length" of another
      (= is "twice as long"). Very informally, many ratio scales can be described
      as specifying "how much" of something (i.e. an amount or magnitude) or "how
      many" (a count). The Kelvin temperature scale is a ratio scale because it has
      a unique, non-arbitrary zero point called absolute zero.
    is_a: qudt_Scale
    name: qudt_RatioScale
    see_also:
    - http://qudt.org/schema/qudt/IntervalScale
    - http://qudt.org/schema/qudt/NominalScale
    - http://qudt.org/schema/qudt/OrdinalScale
    source: http://qudt.org/schema/qudt
    title: Ratio scale
  qudt_Rule:
    class_uri: qudt:Rule
    is_a: qudt_Verifiable
    name: qudt_Rule
    source: http://qudt.org/schema/qudt
    title: Rule
  qudt_RuleType:
    class_uri: qudt:RuleType
    is_a: qudt_EnumeratedValue
    name: qudt_RuleType
    source: http://qudt.org/schema/qudt
    title: Rule Type
  qudt_ScalarDatatype:
    class_uri: qudt:ScalarDatatype
    description: Scalar data types are those that have a single value. The permissible
      values are defined over a domain that may be integers, float, character or boolean.
      Often a scalar data type is referred to as a primitive data type.
    is_a: qudt_Datatype
    name: qudt_ScalarDatatype
    source: http://qudt.org/schema/qudt
    title: Scalar Datatype
  qudt_Scale:
    class_uri: qudt:Scale
    description: Scales (also called "scales of measurement" or "levels of measurement")  are
      expressions that typically refer to the theory of scale types.
    is_a: qudt_Concept
    name: qudt_Scale
    source: http://qudt.org/schema/qudt
    title: Scale
  qudt_ScaleType:
    class_uri: qudt:ScaleType
    is_a: qudt_EnumeratedValue
    name: qudt_ScaleType
    source: http://qudt.org/schema/qudt
    title: Scale type
  qudt_SignednessType:
    class_uri: qudt:SignednessType
    name: qudt_SignednessType
    slots:
    - rdfs_label
    - rdfs_isDefinedBy
    - dtype_literal
  qudt_SolidAngleUnit:
    class_uri: qudt:SolidAngleUnit
    description: The solid angle subtended by a surface S is defined as the surface
      area of a unit sphere covered by the surface S's projection onto the sphere.
      A solid angle is related to the surface of a sphere in the same way an ordinary
      angle is related to the circumference of a circle. Since the total surface area
      of the unit sphere is 4*pi, the measure of solid angle will always be between
      0 and 4*pi.
    is_a: qudt_AngleUnit
    name: qudt_SolidAngleUnit
    source: http://qudt.org/schema/qudt
    title: Solid Angle Unit
  qudt_Statement:
    class_uri: qudt:Statement
    is_a: rdf_Statement
    name: qudt_Statement
    source: http://qudt.org/schema/qudt
    title: Statement
  qudt_StringEncodingType:
    class_uri: qudt:StringEncodingType
    name: qudt_StringEncodingType
    title: No class (entity type) name specified -- this class is noted as a superclass
      of another class in this graph but has not itself been defined.
  qudt_Symbol:
    class_uri: qudt:Symbol
    is_a: qudt_Concept
    name: qudt_Symbol
    source: http://qudt.org/schema/qudt
    title: Symbol
  qudt_SystemOfQuantityKinds:
    class_uri: qudt:SystemOfQuantityKinds
    description: "A system of quantity kinds is a set of one or more quantity kinds\
      \ together with a set of zero or more algebraic equations that define relationships\
      \ between quantity kinds in the set. In the physical sciences, the equations\
      \ relating quantity kinds are typically physical laws and definitional relations,\
      \ and constants of proportionality. Examples include Newton\u2019s First Law\
      \ of Motion, Coulomb\u2019s Law, and the definition of velocity as the instantaneous\
      \ change in position.  In almost all cases, the system identifies a subset of\
      \ base quantity kinds. The base set is chosen so that all other quantity kinds\
      \ of interest can be derived from the base quantity kinds and the algebraic\
      \ equations. If the unit system is explicitly associated with a quantity kind\
      \ system, then the unit system must define at least one unit for each quantity\
      \ kind.  From a scientific point of view, the division of quantities into base\
      \ quantities and derived quantities is a matter of convention."
    is_a: qudt_Concept
    name: qudt_SystemOfQuantityKinds
    source: http://qudt.org/schema/qudt
    title: System of Quantity Kinds
  qudt_SystemOfUnits:
    class_uri: qudt:SystemOfUnits
    description: A system of units is a set of units which are chosen as the reference
      scales for some set of quantity kinds together with the definitions of each
      unit. Units may be defined by experimental observation or by proportion to another
      unit not included in the system. If the unit system is explicitly associated
      with a quantity kind system, then the unit system must define at least one unit
      for each quantity kind.
    is_a: qudt_Verifiable
    name: qudt_SystemOfUnits
    source: http://qudt.org/schema/qudt
    title: System of Units
  qudt_TransformType:
    class_uri: qudt:TransformType
    is_a: qudt_EnumeratedValue
    name: qudt_TransformType
    source: http://qudt.org/schema/qudt
    title: Transform type
  qudt_Unit:
    class_uri: qudt:Unit
    description: "A unit of measure, or unit, is a particular quantity value that\
      \ has been chosen as a scale for measuring other quantities the same kind (more\
      \ generally of equivalent dimension). \u240A  For example, the meter is a quantity\
      \ of length that has been rigorously defined and standardized by the BIPM (International\
      \ Board of Weights and Measures). \u240A  Any measurement of the length can\
      \ be expressed as a number multiplied by the unit meter. \u240A  More formally,\
      \ the value of a physical quantity Q with respect to a unit (U) is expressed\
      \ as the scalar multiple of a real number (n) and U, as  $Q = nU$."
    is_a: qudt_Verifiable
    name: qudt_Unit
