  qudt_coherentUnitSystem:
    description: "A system of units is coherent with respect to a system of quantities\
      \ and equations if the system of units is chosen in such a way that the equations\
      \ between numerical values have exactly the same form (including the numerical\
      \ factors) as the corresponding equations between the quantities. \u240A  In\
      \ such a coherent system, no numerical factor other than the number 1 ever occurs\
      \ in the expressions for the derived units in terms of the base units. \u240A\
      \  For example, the $newton$ and the $joule$. \u240A  These two are, respectively,\
      \ the force that causes one kilogram to be accelerated at 1 metre per (1) second\
      \ per (1) second, and the work done by 1 newton acting over 1 metre. \u240A\
      \  Being coherent refers to this consistent use of 1. \u240A  In the old c.g.s.\
      \ system , with its base units the centimetre and the gram, the corresponding\
      \ coherent units were the dyne and the erg,\u240A   respectively the force that\
      \ causes 1 gram to be accelerated at 1 centimetre per (1) second per (1) second,\
      \ and the work done by 1 dyne acting over 1 centimetre. \u240A  So $1\\,newton\
      \ = 10^5 dyne$, $1 joule = 10^7 erg$, making each of the four compatible in\
      \ a decimal sense within its respective other system, but not coherent therein.</p>"
    name: qudt_coherentUnitSystem
    notes:
    - No occurrences of this slot in the graph.
    range: Any
    slot_uri: qudt:coherentUnitSystem
    source: http://qudt.org/schema/qudt
    subproperty_of: qudt_hasUnitSystem
    title: coherent unit system
