  qudt_currencyExponent:
    description: The currency exponent indicates the number of decimal places between
      a major currency unit and its minor currency unit. For example, the US dollar
      is the major currency unit of the United States, and the US cent is the minor
      currency unit. Since one cent is 1/100 of a dollar, the US dollar has a currency
